Insert into JURISPRUDENCIA.TESE (SEQ_TESE,DSC_TESE,NUM_TESE,TIP_TESE) values ('170','Recurso extraordinário em que se discute, à luz dos artigos 5º, XXXVII e LIII; 93, III; 94 e 98, I, da Constituição Federal, a nulidade, ou não, de julgamento realizado por órgão fracionário de tribunal, composto majoritariamente por juízes convocados, tendo em conta os princípios do juiz natural e do duplo grau de jurisdição.','170','REPERCUSSAO_GERAL');
Insert into JURISPRUDENCIA.TESE (SEQ_TESE,DSC_TESE,NUM_TESE,TIP_TESE) values ('224','Recurso extraordinário em que se discute, à luz dos artigos 5º, II; 37; 59; 84, IV; 146, III, a; 150, I e IV; e 153, III, da Constituição Federal, a natureza jurídica dos juros, a fim de se decidir se verbas recebidas a esse título, em reclamatória trabalhista, se sujeitam, ou não, ao Imposto de Renda.','306','REPERCUSSAO_GERAL');
Insert into JURISPRUDENCIA.TESE (SEQ_TESE,DSC_TESE,NUM_TESE,TIP_TESE) values ('173','Recurso extraordinário em que se discute, à luz dos artigos 5º, LIV e LV; 129, III e VIII; e 144, IV, § 4°, da Constituição Federal, a constitucionalidade, ou não, da realização de procedimento investigatório de natureza penal pelo Ministério Público.','184','REPERCUSSAO_GERAL');
Insert into JURISPRUDENCIA.TESE (SEQ_TESE,DSC_TESE,NUM_TESE,TIP_TESE) values ('195','Recurso extraordinário em que se discute, à luz do art. 114, VI, da Constituição Federal, qual a Justiça competente, se a especializada ou a comum, para processar e julgar as ações indenizatórias decorrentes de acidente do trabalho propostas pelos sucessores do trabalhador falecido.','242','REPERCUSSAO_GERAL');
Insert into JURISPRUDENCIA.TESE (SEQ_TESE,DSC_TESE,NUM_TESE,TIP_TESE) values ('313','Recurso extraordinário em que se discute, à luz do art. 125, § 4º, da Constituição Federal, a competência, ou não, de Tribunal de Justiça estadual determinar, no bojo de processo autônomo de perda de posto e patente de militar, a reforma de policial militar, julgado inapto a permanecer nas fileiras da corporação.','358','REPERCUSSAO_GERAL');
Insert into JURISPRUDENCIA.TESE (SEQ_TESE,DSC_TESE,NUM_TESE,TIP_TESE) values ('346','Recurso extraordinário em que se discute, à luz dos artigos 5º, II, XXII, XXXVI, LIV e LV; e 170, II, da Constituição Federal, a responsabilização, ou não, do empregador por obrigações trabalhistas, no caso de sucessão de empresa.','333','REPERCUSSAO_GERAL');
Insert into JURISPRUDENCIA.TESE (SEQ_TESE,DSC_TESE,NUM_TESE,TIP_TESE) values ('432','Recurso extraordinário em que se discute, à luz dos artigos 227 e 229 da Constituição Federal, a constitucionalidade, ou não, de decisão que, com fundamento em interpretação sistemática do art. 75, §1º, da Lei nº 6.815/80, concede ordem de habeas corpus para manter, no território brasileiro, estrangeiro expulso cuja prole brasileira foi concebida posteriormente ao fato motivador do ato expulsório, considerando-se, de um lado, o princípio da soberania nacional e, de outro lado, o princípio da proteção da família.','373','REPERCUSSAO_GERAL');
Insert into JURISPRUDENCIA.TESE (SEQ_TESE,DSC_TESE,NUM_TESE,TIP_TESE) values ('350','Recurso extraordinário em que se discute, à luz do art. 5º, XLIII, da Constituição Federal, a possibilidade, ou não, de concessão da liberdade provisória a preso em flagrante pela prática de tráfico ilícito de entorpecentes.','192','REPERCUSSAO_GERAL');
Insert into JURISPRUDENCIA.TESE (SEQ_TESE,DSC_TESE,NUM_TESE,TIP_TESE) values ('452','Agravo de instrumento interposto contra decisão que inadmitiu recurso extraordinário em que se discute, à luz do art. 100 da Constituição Federal, se a PARANAPREVIDÊNCIA faz jus, ou não, ao rito do artigo 730 do CPC, nas hipóteses de execução de quantia em dinheiro.','411','REPERCUSSAO_GERAL');
Insert into JURISPRUDENCIA.TESE (SEQ_TESE,DSC_TESE,NUM_TESE,TIP_TESE) values ('516','Recurso extraordinário com agravo em que se discute, à luz dos incisos I e II do art. 114 da Constituição Federal, a competência para processar e julgar processo que tem por objeto a abusividade de greve de servidores públicos regidos pela Consolidação das Leis do Trabalho – CLT.','544','REPERCUSSAO_GERAL');
Insert into JURISPRUDENCIA.TESE (SEQ_TESE,DSC_TESE,NUM_TESE,TIP_TESE) values ('531','Recurso extraordinário em que se discute, à luz do art. 29, VIII, da Constituição Federal, se a imunidade material de vereador por suas opiniões, palavras e votos alcança, ou não, obrigação de indenizar decorrente de responsabilidade civil.','469','REPERCUSSAO_GERAL');
Insert into JURISPRUDENCIA.TESE (SEQ_TESE,DSC_TESE,NUM_TESE,TIP_TESE) values ('441','Recurso extraordinário em que se discute, à luz dos artigos 1º, III, e 5º, II, XLVI, LXV, da Constituição Federal, a possibilidade, ou não, de se determinar o cumprimento de pena privativa de liberdade em prisão domiciliar, ante a inexistência de vagas em estabelecimento penitenciário adequado à execução no regime semi-aberto. ','423','REPERCUSSAO_GERAL');
Insert into JURISPRUDENCIA.TESE (SEQ_TESE,DSC_TESE,NUM_TESE,TIP_TESE) values ('1037','Recurso extraodinário com agravo em que se discute, à luz do art. 7º, XXIX, da Constituição Federal, o prazo da prescrição da ação proposta em razão de acidente de trabalho em face da  emenda Constitucional 45, de 2004.','466','PRE_TEMA');
Insert into JURISPRUDENCIA.TESE (SEQ_TESE,DSC_TESE,NUM_TESE,TIP_TESE) values ('817','Recurso Extraordinário que, à luz do art. 29, inciso VIII, da CF/88, pugna contra acórdão que condenou vereador a pagamento de indenização a título de danos morais por ofensa em pronunciamento feito no exercício de suas funções.','246','PRE_TEMA');
Insert into JURISPRUDENCIA.TESE (SEQ_TESE,DSC_TESE,NUM_TESE,TIP_TESE) values ('819','Recurso extraordinário com agravo em que se discute, à luz do art. 7º, XXIX da Constituição Federal, qual o prazo prescricional, se parcial ou total, para se pleitear complementação de proventos interrompida após aposentadoria por invalidez.','248','PRE_TEMA');
Insert into JURISPRUDENCIA.TESE (SEQ_TESE,DSC_TESE,NUM_TESE,TIP_TESE) values ('1001','Recurso Extraordinário com agravo em que se discute, à luz do art. 37, § 6º, da Constituição Federal, a responsabilidade civil estatal por danos morais decorrentes de prisão indevida.','430','PRE_TEMA');
Insert into JURISPRUDENCIA.TESE (SEQ_TESE,DSC_TESE,NUM_TESE,TIP_TESE) values ('1322','Recurso Extraordinário em que se discute, à luz dos arts. 37, § 6º e 5º, LXXVIII da CF/88, a responsabilidade civil objetiva do Estado e a responsabilidade civil pessoal do Magistrado por danos decorrentes da demora na prestação jurisdicional.','751','PRE_TEMA');
Insert into JURISPRUDENCIA.TESE (SEQ_TESE,DSC_TESE,NUM_TESE,TIP_TESE) values ('1334','Recurso Extraordinário em que se discute à luz do artigo 153, III da Constituição Federal a incidência de imposto de renda sobre abono pecuniário recebido em decorrência de acordo coletivo de trabalho. ','763','PRE_TEMA');
Insert into JURISPRUDENCIA.TESE (SEQ_TESE,DSC_TESE,NUM_TESE,TIP_TESE) values ('1354','Agravo interposto contra decisão que inadmitiu recurso extraordinário em que se discute, à luz do art. 37, II, e §2º, da Constituição Federal, efeitos trabalhistas decorrentes da contratação de empregado por pessoa jurídica de direito privado prestadora de serviço social autônomo, sem submissão à regra da prévia aprovação em concurso público.','783','PRE_TEMA');
Insert into JURISPRUDENCIA.TESE (SEQ_TESE,DSC_TESE,NUM_TESE,TIP_TESE) values ('1446','Agravo em Recurso Extraordinário em que se discute com fundamento no art. 114 da CF/88, sobre a competência para julgamento de prestação de contas de ex-empregado, gestor de negócios, por vendas realizadas em nome do ex-empregador.','875','PRE_TEMA');
Insert into JURISPRUDENCIA.TESE (SEQ_TESE,DSC_TESE,NUM_TESE,TIP_TESE) values ('1526','Recurso Extraordinário com Agravo em que se discute, à luz do art. 114, I e II da CF/88, a competência, ou não, da Justiça do Trabalho para julgar a abusividade de greve de servidores públicos celetistas.','955','PRE_TEMA');
Insert into JURISPRUDENCIA.TESE (SEQ_TESE,DSC_TESE,NUM_TESE,TIP_TESE) values ('1121','Recurso extraordinário em que se discute, à luz do art. 5º, XXXV e XXXVI da CF/1988, a possibilidade, ou não, de redução do valor de multa cominatória, em ação de indenizatória por danos morais ou materiais.','550','PRE_TEMA');
Insert into JURISPRUDENCIA.TESE (SEQ_TESE,DSC_TESE,NUM_TESE,TIP_TESE) values ('1903','Recurso extraordinário no qual se discute, à luz do inciso V do art. 170, do caput do art. 207 e do art. 209 da Constituição Federal, se fere a autonomia universitária a decisão que, lastreada no princípio da defesa do consumidor, determina que o pagamento das mensalidades das instituições privadas de ensino superior seja proporcional à quantidade de disciplinas cursadas.','547','REPERCUSSAO_GERAL');
Insert into JURISPRUDENCIA.TESE (SEQ_TESE,DSC_TESE,NUM_TESE,TIP_TESE) values ('1781','Agravo de instrumento contra decisão que não admitiu recurso extraordinário em que se discute, à luz dos arts. 5º, II e XXXVI; e 7º, I, da Constituição Federal, se a aposentadoria espontânea extingue, ou não, o contrato de trabalho.    ','1','CONTROVERSIA');
Insert into JURISPRUDENCIA.TESE (SEQ_TESE,DSC_TESE,NUM_TESE,TIP_TESE) values ('1845','Recurso Extraordinário com agravo em que se discute, à luz do art. 37, § 6º, da Constituição Federal, a caracterização, ou não, de responsabilidade civil do Estado por danos morais decorrentes de prisão indevida.    ','33','CONTROVERSIA');
Insert into JURISPRUDENCIA.TESE (SEQ_TESE,DSC_TESE,NUM_TESE,TIP_TESE) values ('1887','Recurso extraordinário em que se discute, à luz do art. 37, XVI e XVII, da Constituição Federal, a possibilidade, ou não, da acumulação de proventos com vencimentos de empregados públicos, em face dos efeitos da concessão da aposentadoria espontânea.    ','61','CONTROVERSIA');
Insert into JURISPRUDENCIA.TESE (SEQ_TESE,DSC_TESE,NUM_TESE,TIP_TESE) values ('1852','Recurso extraordinário em que se discute, à luz dos arts. 7º, XXVI, 8º, III e VI, e 202, caput e §2º, da Constituição Federal, a possibilidade, ou não, de o acordo coletivo de trabalho limitar a concessão de uma vantagem - alteração de nível - somente aos empregados em atividade.       ','41','CONTROVERSIA');
Insert into JURISPRUDENCIA.TESE (SEQ_TESE,DSC_TESE,NUM_TESE,TIP_TESE) values ('1886','Recurso extraordinário com agravo em que se discute, à luz dos arts. 114, I; e 198, §5º, da Constituição Federal, a competência, ou não, da Justiça do Trabalho para processar e julgar ação que discute verbas trabalhistas, referentes a período regido pela CLT, supostamente devidas a empregados públicos ¿ com fundamento na Emenda Constitucional n.º 51/2006 e na Lei Federal n.º 11.350/2006 ¿ que migraram, posteriormente, para o regime estatutário.    ','59','CONTROVERSIA');
Insert into JURISPRUDENCIA.TESE (SEQ_TESE,DSC_TESE,NUM_TESE,TIP_TESE) values ('1882','Recurso extraordinário com agravo em que se discute à luz do artigo 7º, XXIX, da Constituição Federal, qual o marco inicial da contagem do prazo prescricional estabelecido no referido dispositivo constitucional, em face da decisão do STF que entendeu que a aposentadoria espontânea do trabalhador não extingue o contrato de trabalho.    ','52','CONTROVERSIA');
Insert into JURISPRUDENCIA.TESE (SEQ_TESE,DSC_TESE,NUM_TESE,TIP_TESE) values ('1637','Agravo de instrumento interposto contra decisão que inadmitiu recurso extraordinário, em que se discute à luz dos arts. 5º, II e XXXV; 37, caput; e 202, da Constituição Federal, a possibilidade, ou não, do pagamento de indenização em dobro, com base na estabilidade decenal, a ex-servidor da Empresa Brasileira de Correios e Telégrafos, referente ao período do regime estatutário regido pela Lei Federal nº 1.711/1.952, anterior à opção pela CLT e FGTS.','1066','PRE_TEMA');
Insert into JURISPRUDENCIA.TESE (SEQ_TESE,DSC_TESE,NUM_TESE,TIP_TESE) values ('1492','Agravo de Instrumento contra decisão que inadmitiu Recurso extraordinário em que se discute, à luz dos arts. 5º, XXXV, e 114, § 2º, da Constituição Federal, a necessidade, ou não, de "comum acordo" como pressuposto processual para o ajuizamento de dissídio coletivo de natureza econômica na Justiça do Trabalho.','921','PRE_TEMA');
Insert into JURISPRUDENCIA.TESE (SEQ_TESE,DSC_TESE,NUM_TESE,TIP_TESE) values ('771','Recurso extraordinário em que se discute, à luz do art. XXX, da Constituição Federal, se pessoa jurídica de direito privado sem fins lucrativos tem direito, ou não, ao benefício da gratuidade de justiça.','200','PRE_TEMA');
Insert into JURISPRUDENCIA.TESE (SEQ_TESE,DSC_TESE,NUM_TESE,TIP_TESE) values ('847','Recurso Extraordinário com Agravo em que se discute, à luz dos artigos 7º, XXIX da Constituição Federal a prescrição incidente sobre pedido de complementação de aposentadoria relativa ao auxílio-alimentação suprimido antes da aposentadoria do empregado e jamais recebido após o jubilamento.','276','PRE_TEMA');
Insert into JURISPRUDENCIA.TESE (SEQ_TESE,DSC_TESE,NUM_TESE,TIP_TESE) values ('741','Recurso extraordinário com agravo em que se discute, à luz dos arts. 5º, II, 7º, XXIX, da Constituição Federal, se está prescrito, ou não, com base em acordo coletivo, o direito dos empregados perceberem o pagamento das diferenças de PLR dos exercícios financeiros de 1997, 1998 e 1999, que supostamente foram distribuídos em 2001 apenas aos acionistas como dividendo e juros sobre capital próprio.','170','PRE_TEMA');
Insert into JURISPRUDENCIA.TESE (SEQ_TESE,DSC_TESE,NUM_TESE,TIP_TESE) values ('1148','Recurso Extraordinário com Agravo em que se discute, à luz do artigo 7º, XXIX da Constituição Federal a aplicabilidade da prescrição às ações que tenham por objeto anotação da carteira de trabalho para fins de prova junto à Previdência Social, a teor do artigo 11, § 1º da CLT. ','577','PRE_TEMA');
Insert into JURISPRUDENCIA.TESE (SEQ_TESE,DSC_TESE,NUM_TESE,TIP_TESE) values ('1460','Recurso extraordinário com agravo em que se discute, à luz do art. 37, IX, e 39, § 3º, da Constituição Federal, o direito, ou não, ao pagamento de parcelas salariais a servidor público temporário contratado irregularmente. ','889','PRE_TEMA');
Insert into JURISPRUDENCIA.TESE (SEQ_TESE,DSC_TESE,NUM_TESE,TIP_TESE) values ('1158','Recurso extraordinário com agravo em que se discute, à luz do artigo 7º, XXIX da Constituição Federal, a aplicabilidade, ou não, da prescrição quinquenal intercorrente no curso do processo de execução trabalhista. ','587','PRE_TEMA');
Insert into JURISPRUDENCIA.TESE (SEQ_TESE,DSC_TESE,NUM_TESE,TIP_TESE) values ('1160','Recurso extraordinário com agravo em que se discute, à luz do art. 7º, XXIX, da Constituição Federal, a incidência da decretação da prescrição sobre parcelas trabalhistas não impugnadas na contestação.','589','PRE_TEMA');
Insert into JURISPRUDENCIA.TESE (SEQ_TESE,DSC_TESE,NUM_TESE,TIP_TESE) values ('839','Agravo em Recurso Extraordinário em que se discute, à luz dos arts 5º, inciso XXXV, LIV e LV; 93, IX; bem como do art. 10 do ADCT da Constituição Federal, a negativa de prestação jurisdicional em sede de Reclamação Trabalhista que versa sobre dispensa sem justa causa de empregada doméstica.','268','PRE_TEMA');
Insert into JURISPRUDENCIA.TESE (SEQ_TESE,DSC_TESE,NUM_TESE,TIP_TESE) values ('1663','Recurso extraordinário com agravo em que se discute, à luz dos arts. 7º; 37, inc. IX; 39, §3º da CF/88, se servidores contratados administrativamente em caráter temporário tem direito ao recebimento de verbas sociais não previstas no contrato firmado, como gratificação natalina, férias, terço constitucional de férias.','1092','PRE_TEMA');
Insert into JURISPRUDENCIA.TESE (SEQ_TESE,DSC_TESE,NUM_TESE,TIP_TESE) values ('1067','Prescrição da pretensão de reajuste de complementação de aposentadoria relativos ao abono-complementação instituído pela Fundação Vale do Rio Doce de Seguridade Social - VALIA.
Insert into JURISPRUDENCIA.TESE (SEQ_TESE,DSC_TESE,NUM_TESE,TIP_TESE) values ('1691','Agravo instrumento interposto contra decisão que inadmitiu em recurso extraordinário em que se discute, à luz do art. 53, da Constituição Federal, se a imunidade por opiniões, palavras e votos de Deputados e Senadores, alcança, ou não,  a obrigação por responsabilidade civil.','1120','PRE_TEMA');
Insert into JURISPRUDENCIA.TESE (SEQ_TESE,DSC_TESE,NUM_TESE,TIP_TESE) values ('748','Recurso Extraordinário em que se discute, à luz dos artigos 5º, II, LV e 173, da Constituição Federal, a possibilidade, ou não, de inclusão do Estado no pólo passivo de execução trabalhista movida contra sociedade de economia mista em condição de insolvência.','177','PRE_TEMA');
Insert into JURISPRUDENCIA.TESE (SEQ_TESE,DSC_TESE,NUM_TESE,TIP_TESE) values ('749','Recurso extraordinário com agravo em que se discute, à luz dos arrtigos 5º, XXXV, LIV, LV e 7º, XXIX da Constituição Federal, a extensão de assistência médica supletiva a empregado aposentado por invalidez. Alegação de inexistência de lei ou norma interna concessiva do benefício.','178','PRE_TEMA');
Insert into JURISPRUDENCIA.TESE (SEQ_TESE,DSC_TESE,NUM_TESE,TIP_TESE) values ('1082','Agravo interposto contra decisão que inadmitiu recurso extraordinário em que se discute, à luz do art. 40, § 7º, da Constituição Federal, o direito  de pensionistas de ex-empregados da extinta Ferrovia Paulista S/A ¿ FEPASA, à integralidade no valor da pensão recebida, com base no art. 40, §5º, da Carta Magna, com redação anterior à EC nº 20/1998, e nos artigos 192 e 193 do Decreto Estadual nº 35.530/1959.','511','PRE_TEMA');
Insert into JURISPRUDENCIA.TESE (SEQ_TESE,DSC_TESE,NUM_TESE,TIP_TESE) values ('1155','Agravo em recurso extraordinário em que se discute, à luz do art. 40, § 4º, da Constituição Federal, a possibilidade, ou não, de decisão judicial desconsiderar o quanto foi decidido em acordo coletivo.','584','PRE_TEMA');
Insert into JURISPRUDENCIA.TESE (SEQ_TESE,DSC_TESE,NUM_TESE,TIP_TESE) values ('1036','Recurso extraordinário com agravo em que se discute, à luz do art. 37, § 6º da Constituição Federal, a responsabilidade objetiva do Estado, em razão de morte de detento.','465','PRE_TEMA');
Insert into JURISPRUDENCIA.TESE (SEQ_TESE,DSC_TESE,NUM_TESE,TIP_TESE) values ('1516','Recurso extraordinário em que se discute, à luz artigo 5º, inciso LV da CF/88, a possibilidade ou não da cobrança de complementação de seguro facultativo pelos lucros cessantes, do responsável por acidente de veículo causado àquele que utiliza o bem como ferramenta de trabalho e que permaneceu paralisado para conserto das avarias sofridas, o que impossibilitou o exercício das atividades profissionais.','945','PRE_TEMA');
Insert into JURISPRUDENCIA.TESE (SEQ_TESE,DSC_TESE,NUM_TESE,TIP_TESE) values ('1617','Agravo de instrumento interposto contra decisão que inadmitiu recurso extraordinário, em que se discute à luz dos arts. 5°, II, XIII e XXXVI; 100; 173; 175; e 195, §7°, da Constituição Federal, a natureza jurídica de Fundação criada por lei municipal, antes do Novo Código Civil, para fins de execução por ofício precatório. ','1046','PRE_TEMA');
Insert into JURISPRUDENCIA.TESE (SEQ_TESE,DSC_TESE,NUM_TESE,TIP_TESE) values ('880','Recurso extraordinário com agravo em que se discute, à luz dos artigos 5º, caput, incisos II, XXXVI, LIV, LV e 7º, VI, XXX, da Constituição Federal, a possibilidade, ou não, de se reajustar aposentadoria de empregado do antigo Banespa pelo índice do IGP-DI e mais 12% de juros ao ano, ou sucessivamente àqueles conferidos pelas convenções ou acordos coletivos de trabalho, em face da não opção do plano de complementação de aposentadoria. ','309','PRE_TEMA');
Insert into JURISPRUDENCIA.TESE (SEQ_TESE,DSC_TESE,NUM_TESE,TIP_TESE) values ('7963','Recurso extraordinário em que se discute, à luz do art. 5º, XXXV e XXXVI, e 60, § 4º, da Constituição Federal, a constitucionalidade do § 2º do art. 114 da Lei Maior, na redação dada pela EC 45/2004, que condiciona o ajuizamento de dissídio coletivo de natureza econômica à existência de comum acordo entre as partes.','841','REPERCUSSAO_GERAL');
Insert into JURISPRUDENCIA.TESE (SEQ_TESE,DSC_TESE,NUM_TESE,TIP_TESE) values ('3762','Recurso extraordinário em que se discute — à luz dos arts. 1º, IV, 2º, 3º, I, 4º, IV, 5º, II, 7º, I, 114, 170, II e parágrafo único, da Constituição federal, bem como do art. 10, II, do Ato das Disposições Constitucionais Transitórias — a imposição, pelo Tribunal Superior do Trabalho, da obrigatoriedade de negociação coletiva para a dispensa em massa de trabalhadores.','638','REPERCUSSAO_GERAL');
Insert into JURISPRUDENCIA.TESE (SEQ_TESE,DSC_TESE,NUM_TESE,TIP_TESE) values ('2582','Recurso extraordinário com agravo em que se discute, à luz do inciso XXXVI do art. 5º e do inciso XXIX do art. 7º da Constituição Federal, a prescrição aplicável (total ou parcial) no âmbito da Justiça do Trabalho.','583','REPERCUSSAO_GERAL');
Insert into JURISPRUDENCIA.TESE (SEQ_TESE,DSC_TESE,NUM_TESE,TIP_TESE) values ('6582','Recurso extraordinário em que se discute, à luz dos arts. 5º, LVII, e 97 da Constituição federal, se ofende o princípio da presunção de inocência a aplicação do quanto disposto no art. 52 da Lei 7.210/1984 (Lei de Execução Penal – LEP) – a prática de fato previsto como crime doloso constitui falta grave – antes do advento de sentença penal condenatória transitada em julgado.','758','REPERCUSSAO_GERAL');
Insert into JURISPRUDENCIA.TESE (SEQ_TESE,DSC_TESE,NUM_TESE,TIP_TESE) values ('8102','Recurso extraordinário em que se discute, à luz dos arts. 7º, XXIX, 39 e 114 da Constituição Federal, a competência, ou não, da Justiça Trabalhista para processar e julgar demanda instaurada entre  o Poder Público e servidores a ele vinculados por contrato de trabalho regido pela CLT.','853','REPERCUSSAO_GERAL');
Insert into JURISPRUDENCIA.TESE (SEQ_TESE,DSC_TESE,NUM_TESE,TIP_TESE) values ('1267','.Recurso extraordinário em que se discute, à luz dos artigos 5º, II; 37; 59; 84, IV; 146, III, a; 150, I e IV; e 153, III, da Constituição Federal, a natureza jurídica dos juros, a fim de se decidir se verbas recebidas a esse título, em reclamatória trabalhista, se sujeitam, ou não, ao Imposto de Renda.','696','PRE_TEMA');
Insert into JURISPRUDENCIA.TESE (SEQ_TESE,DSC_TESE,NUM_TESE,TIP_TESE) values ('2704','Recurso extraordinário em que se discute, à luz do inciso XXVI do art. 7º e dos incisos III e VI do art. 8º da Constituição Federal, a possibilidade, ou não, de extensão, às complementações de aposentadoria, de benefício concedido indistintamente aos empregados da ativa, em razão de acordo coletivo de trabalho. ','591','REPERCUSSAO_GERAL');
Insert into JURISPRUDENCIA.TESE (SEQ_TESE,DSC_TESE,NUM_TESE,TIP_TESE) values ('3362','Agravo contra decisão que inadmitiu recurso extraordinário em que se discute, à luz dos arts. 2º; 5º, XLIII; e 52, X, da Constituição Federal, a constitucionalidade da vedação à conversão da pena privativa de liberdade pela pena restritiva de direitos, prevista nos arts. 33, § 4º, e 44, caput, da Lei 11.343/2006.','626','REPERCUSSAO_GERAL');
Insert into JURISPRUDENCIA.TESE (SEQ_TESE,DSC_TESE,NUM_TESE,TIP_TESE) values ('1672','Recurso extraordinário com agravo em que se discute a luz do art. 5º, caput e II, da Constituição Federal, a aplicabilidade, ou não, da forma de incidência dos juros de mora, disposto no artigo 1º-F, da lei nº 9.494/1997, com redação da MP nº 2180-35/2001 e da Lei nº 11.960/2009, nos casos de condenação subsidiária da Fazenda Pública.','1101','PRE_TEMA');
Insert into JURISPRUDENCIA.TESE (SEQ_TESE,DSC_TESE,NUM_TESE,TIP_TESE) values ('814','Recurso Extraordinário com agravo em que se discute, à luz dos arts. 113 e 114 da CF/88, a incompetência da justiça do trabalho nas ações que envolvam a execução de crédito trabalhista incluído na recuperação judicial de empresas, conforme previsto na Lei Federal nº 11.101/2005.','243','PRE_TEMA');
Insert into JURISPRUDENCIA.TESE (SEQ_TESE,DSC_TESE,NUM_TESE,TIP_TESE) values ('2722','Recurso extraordinário com agravo em que se discute, à luz do § 6º do art. 37 da Constituição Federal, a responsabilidade civil objetiva do Estado por morte de detento.','592','REPERCUSSAO_GERAL');
Insert into JURISPRUDENCIA.TESE (SEQ_TESE,DSC_TESE,NUM_TESE,TIP_TESE) values ('5462','Recurso extraordinário em que se discute, à luz do art. 5º, LXI, da Constituição federal, a recepção do art. 47 da Lei 6.880/1980, que possibilita a definição, por meio de decreto regulamentar, dos casos de prisão e detenção disciplinares por transgressão militar. Em consequência, discute-se também a validade das disposições contidas no Decreto 4.346/2002 (Regulamento Disciplinar do Exército) pertinentes à aplicação das referidas penalidades.','703','REPERCUSSAO_GERAL');
Insert into JURISPRUDENCIA.TESE (SEQ_TESE,DSC_TESE,NUM_TESE,TIP_TESE) values ('2962','Recurso extraordinário com agravo em que se discute, à luz do caput e dos incisos II, XXII e LIV do art. 5º; bem como dos incisos III e XXIX do art. 7º, todos da Constituição Federal, o prazo prescricional aplicável à cobrança de valores não depositados no Fundo de Garantia por Tempo de Serviço - FGTS.','608','REPERCUSSAO_GERAL');
Insert into JURISPRUDENCIA.TESE (SEQ_TESE,DSC_TESE,NUM_TESE,TIP_TESE) values ('1340','Agravo contra decisão que inadmitiu recurso extraordinário em que se discute, à luz do art. 7, XXVI e 114, I da CF/88 a competência da Justiça do Trabalho para julgar causas envolvendo discussão sobre cláusulas de acordos coletivos de trabalho.','769','PRE_TEMA');
Insert into JURISPRUDENCIA.TESE (SEQ_TESE,DSC_TESE,NUM_TESE,TIP_TESE) values ('8243','Recurso extraordinário em que se discute, à luz dos arts. 2º, 5º, II, 7º, XVII, e 59 da Constituição Federal, se o pagamento de férias realizado fora do prazo do art. 145 da Consolidação das Leis do Trabalho deve ser efetuado em dobro.','867','REPERCUSSAO_GERAL');
Insert into JURISPRUDENCIA.TESE (SEQ_TESE,DSC_TESE,NUM_TESE,TIP_TESE) values ('8162','Recurso extraordinário em que se discute, à luz dos arts. 5º, XXXIX, e 22, I, da Constituição Federal, a tipicidade, ou não, da conduta de portar arma branca, tendo em conta a ausência da regulamentação exigida no tipo do art. 19 da Lei das Contravenções Penais.','857','REPERCUSSAO_GERAL');
Insert into JURISPRUDENCIA.TESE (SEQ_TESE,DSC_TESE,NUM_TESE,TIP_TESE) values ('850','Agravo em Recurso Extraordinário em que se discute, à luz do artigo 5º, II, XXXV, LIV, LV, da Constituição Federal, a existência, ou não, de direito adquirido a empregado do SERPRO com relação ao recebimento do Prêmio Produtividade em virtude do artigo 12 da Lei 5.615/70. ','279','PRE_TEMA');
Insert into JURISPRUDENCIA.TESE (SEQ_TESE,DSC_TESE,NUM_TESE,TIP_TESE) values ('56','Recurso extraordinário em que se discute, à luz dos artigos 5º, LV e LX; e art. 93, IX, da Constituição Federal, a constitucionalidade, ou não, do art. 118, § 3º, do Regimento Interno do Superior Tribunal Militar – STM, o qual prevê que o resultado do julgamento de agravo interposto perante aquela Corte será certificado nos autos pela Secretaria do Tribunal Pleno, prescindindo-se da lavratura de acórdão fundamentado.','50','REPERCUSSAO_GERAL');
Insert into JURISPRUDENCIA.TESE (SEQ_TESE,DSC_TESE,NUM_TESE,TIP_TESE) values ('1147','Agravo em Recurso Extraordinário em que se discute, à luz do art. 114, inciso I da CF/88, a definição da justiça competente para julgar a causa em relação à data da publicação da Lei instituidora do Regime jurídico Único dos servidores, a qual efetivou a transposição do regime celetista para o estatutário.','576','PRE_TEMA');
Insert into JURISPRUDENCIA.TESE (SEQ_TESE,DSC_TESE,NUM_TESE,TIP_TESE) values ('3342','Agravo interposto de decisão que não admitiu recurso extraordinário em que se discute, à luz do art. 5º, caput e inciso II, da Constituição Federal, a aplicabilidade dos juros de mora previstos no art. 1º-F da Lei 9.494/1997 aos casos em que a Fazenda Pública é condenada subsidiariamente pelas obrigações trabalhistas inadimplidas pelo empregador principal.','625','REPERCUSSAO_GERAL');
Insert into JURISPRUDENCIA.TESE (SEQ_TESE,DSC_TESE,NUM_TESE,TIP_TESE) values ('1315','Recurso extraordinário com agravo em que se discute, à luz dos arts. 37, II, 114, I, da Constituição Federal e do art. 19, §1º, do ADCT, a competência da Justiça do Trabalho para processar e julgar ação que discute a validade, ou não, da mudança do regime jurídico de celetista para estatutário, por meio de lei municipal, de empregado público cujo vínculo com a Administração Pública tenha ocorrido em período anterior à Constituição Federal, sem prévia aprovação em concurso público, e a prescrição em relação aos créditos trabalhistas referentes a período regido pela CLT.','744','PRE_TEMA');
Insert into JURISPRUDENCIA.TESE (SEQ_TESE,DSC_TESE,NUM_TESE,TIP_TESE) values ('7104','Recurso extraordinário em que se discute, à luz dos arts. 5º, caput e XXXVI, e 7º, VI e XXVI, da Constituição Federal, a validade, ou não, do cálculo do valor do Complemento de Remuneração Mínima por Nível e Regime devido aos empregados da Petrobrás, previsto na Cláusula 35ª do Acordo Coletivo de Trabalho de 2007/2009, mediante a subtração, no valor desse complemento, dos adicionais inerentes ao trabalho em condições especiais.','795','REPERCUSSAO_GERAL');
Insert into JURISPRUDENCIA.TESE (SEQ_TESE,DSC_TESE,NUM_TESE,TIP_TESE) values ('747','Recurso Extraordinário com Agravo em que se discute, à luz dos art. 7º, XI e XXVI; e 8º, III e VI, da Constituição federal, a possibilidade, ou não, de estabelecer participação nos lucros e resultados da empresa, através de norma coletiva, em desacordo com o estabelecido na Lei nº 10.101/00, bem como, constitucionalidade, ou não, de redução do intervalo intrajornada via cláusula coletiva.','176','PRE_TEMA');
Insert into JURISPRUDENCIA.TESE (SEQ_TESE,DSC_TESE,NUM_TESE,TIP_TESE) values ('1145','Trata-se de recurso extraordinário com agravo em que se discute, à luz dos arts. 5º, II, 7º, XVI, 8º, III e VI, 37 e 173, § 1º, da Constituição Federal, possibilidade, ou não, de incorporação do pagamento do adicional de 15%, pago em razão de trabalho nos fins de semana, previsto em instrumento coletivo, após a supressão do labor aos sábados. ','574','PRE_TEMA');
Insert into JURISPRUDENCIA.TESE (SEQ_TESE,DSC_TESE,NUM_TESE,TIP_TESE) values ('1095','Recurso extraordinário com agravo em que se discute, à luz dos arts. 5º, II e XXXVI, da Constituição Federal, a possibilidade, ou não, de empresa sucessora ser responsabilizada por danos materiais e morais causados à consumidor da empresa sucedida.','524','PRE_TEMA');
